import React, { useEffect } from 'react';
import './Home.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faChevronLeft, faChevronRight } from '@fortawesome/free-solid-svg-icons';

function Home() {
  useEffect(() => {
    // Carousel functionality
    const carouselInner = document.querySelector('.carousel-inner');
    const items = document.querySelectorAll('.carousel-item');
    const prevBtn = document.querySelector('.carousel-control.prev');
    const nextBtn = document.querySelector('.carousel-control.next');
    
    let currentIndex = 0;
    const totalItems = items.length;
    
    // Initialize carousel
    updateCarousel();
    
    // Auto slide
    let interval = setInterval(nextSlide, 5000);
    
    function updateCarousel() {
      carouselInner.style.transform = `translateX(-${currentIndex * 100}%)`;
    }
    
    function nextSlide() {
      currentIndex = (currentIndex + 1) % totalItems;
      updateCarousel();
    }
    
    function prevSlide() {
      currentIndex = (currentIndex - 1 + totalItems) % totalItems;
      updateCarousel();
    }
    
    // Event listeners
    prevBtn.addEventListener('click', function() {
      clearInterval(interval);
      prevSlide();
      interval = setInterval(nextSlide, 5000);
    });
    
    nextBtn.addEventListener('click', function() {
      clearInterval(interval);
      nextSlide();
      interval = setInterval(nextSlide, 5000);
    });
    
    // Pause autoplay on hover
    const carousel = document.querySelector('.carousel');
    carousel.addEventListener('mouseenter', function() {
      clearInterval(interval);
    });
    
    carousel.addEventListener('mouseleave', function() {
      interval = setInterval(nextSlide, 5000);
    });

    // Cleanup function
    return () => {
      clearInterval(interval);
    };
  }, []);

  return (
    <>
      {/* Background newspaper overlay */}
      <div className="background-overlay"></div>

      <div className="container">
        <header>
          <h1 className="title">Welcome to Newspaper Ad Booking</h1>
          <p className="subtitle">Your ultimate destination for placing newspaper ads with ease</p>
          
          <div className="nav-container">
            <a href="#" className="nav-button active">Home</a>
            <a href="#" className="nav-button">Explore</a>
            <a href="#" className="nav-button">Ad Booking</a>
            <a href="#" className="nav-button">Login</a>
            <a href="#" className="nav-button">Signup</a>
            <a href="#" className="nav-button">My Profile</a>
            <a href="#" className="nav-button">Contact Us</a>
            <a href="#" className="nav-button">About</a>
          </div>
        </header>

        <main>
          <section className="main-content">
            <h2>Welcome to Newspaper Ad Booking</h2>
            <p>Book ads in your favorite newspaper easily.</p>

            {/* Carousel */}
            <div className="carousel">
              <div className="carousel-inner">
                <div className="carousel-item">
                  <img src="https://via.placeholder.com/800x400" alt="Ad Example 1" />
                  <div className="carousel-caption">
                    <h3>Blockbuster Sale</h3>
                    <p>Get ready for the biggest release of the year!</p>
                  </div>
                </div>
                <div className="carousel-item">
                  <img src="https://via.placeholder.com/800x400" alt="Ad Example 2" />
                  <div className="carousel-caption">
                    <h3>New Property Listings</h3>
                    <p>Find your dream home today</p>
                  </div>
                </div>
                <div className="carousel-item">
                  <img src="https://via.placeholder.com/800x400" alt="Ad Example 3" />
                  <div className="carousel-caption">
                    <h3>Business Showcase</h3>
                    <p>Expand your reach with our classified ads</p>
                  </div>
                </div>
              </div>
              <div className="carousel-control prev">
                <FontAwesomeIcon icon={faChevronLeft} />
              </div>
              <div className="carousel-control next">
                <FontAwesomeIcon icon={faChevronRight} />
              </div>
            </div>
          </section>
        </main>
      </div>
    </>
  );
}

export default Home;
